import getStyling from "./style";
import { FC } from "react";
import { IMappedIconProps } from "./interface";
import {
  IoBuildOutline,
  IoConstructOutline,
  IoSettingsOutline,
  IoHammerOutline,
  IoReaderOutline,
  IoAddCircleOutline,
  IoAdd,
